import { useState } from 'react';
import './appService.scss';
import PhoneRight from '../phoneRight/phoneRight';

const AppService = (): JSX.Element => {

    const [phoneActive, setPhoneActive] = useState<Boolean>(false);

    return (
        <div className="appService">
            <div className="appService__textWrapper">
                <h2>App development</h2>
                <span>Developing an App could be interesting track with up and downs. Is a hybrid solution better then a native solution for your organisation?</span> 
            </div>
        </div>
    );
}

export default AppService;
